import React from 'react';

const DataSidebar = ({ deliveries }) => {
  return (
    <div className="data-sidebar">
      <h2>Delivery Data</h2>
      <ul>
        {deliveries.map((item) => (
          <li key={item._id}>
            <strong>ID:</strong> {item._id}<br />
            <strong>Pickup:</strong> {item.pickup}<br />
            <strong>Delivery:</strong> {item.delivery}<br />
            <strong>Description:</strong> {item.description}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default DataSidebar;
